INSERT INTO `oportunidade_rtc` VALUES (2,'2014-07-10',196,'2014-07-09','Reunião com Orlando (dono)\r\n\r\nObjetivo: entender as expectativas de evolução do atendimento e identificar temperatura da oportunidade.\r\n','10:00:00'),(3,'2014-07-13',275,'2014-07-15','Demonstração do Fluig.\r\n\r\nRecurso - Thiago Melo (Fluig)\r\n\r\nObjetivos: \r\n1) Apresentar a estrutura Fluig como uma solução completa para resolver às necessidades de uma rede corporativa interna. (substituir o ByYou)\r\n\r\n2) Apresentar o BPM para solucionar a necessidade de um portal de chamados para os franqueados.\r\n\r\n','15:00:00'),(4,'2014-07-13',275,'2014-07-15','Discutir a aderência da solução com o cliente e identificar os próximos passos para apresentação de proposta e fechamento.','16:30:00'),(5,'2014-07-13',275,'2014-07-15','Caso seja aderente, passar noção de investimento e trabalhar no convencimento de que o Fluig é a solução não só para estas duas demandas mas para outras que possam surgir.\r\n\r\nCaso a solução não seja aderente, sugerir o trabalho de consultoria para implementação de uma CST.\r\n\r\n','17:00:00'),(6,'2014-07-13',276,'2014-07-14','Conversar com a Vânia Bastos (arquiteta) - saber quanto tempo demora a demonstração do Portal e fechar a data de elaboração da proposta.\r\n\r\nSe valer a pena, negociar antecipação da agenda da arquiteta Vania Bastos para 15/07 - mesmo dia da apresentação do Fluig. ','09:00:00'),(7,'2014-07-13',276,'2014-07-14','Confirmar a data da demonstração com o cliente. 15 ou 17/07.','11:30:00'),(8,'2014-07-13',276,'2014-07-17','Demonstração do Portal para os usuários chave.\r\n\r\nIdentificar quem é o decisor e puxar o compromisso de fechamento dentro do mês.\r\n\r\n/// Demonstração realizada - Não vai fechar no mês.  O cliente está com a Folha de pagamento mal implantada e precisa de uma potencialização.','15:00:00'),(9,'2014-07-13',276,'2014-08-13','Apresentação da proposta - Adiada para Agosto\r\n\r\nO cliente deseja uma proposta de potencialização da folha de pagamento antes de tratar do Portal.\r\n\r\n','16:00:00'),(10,'2014-07-13',276,'2014-08-15','Ajustes na proposta \r\n\r\nIdentificação dos gaps para fechamento na data comitada.\r\n\r\nSolução dos gaps\r\n\r\nGeração de proposta em conjunto com as demais oportunidade.','09:00:00'),(11,'2014-07-13',58,'2014-07-11','- O cliente informou que está dependendo de darmos andamento aos projetos de implantação que estão parados para podermos focar nesta negociação.\r\n\r\n- A diretoria tem grande interesse em implantar uma ferramenta de analitcs.\r\n','16:00:00'),(12,'2014-07-13',58,'2014-07-14','Verificar com o Rafael (GP) o que está faltando para a continuidade nos projetos.\r\n\r\n','10:00:00'),(13,'2014-07-13',58,'2014-07-14','Certificar que teremos tempo para ação nestes projetos e negociação do GoodData dentro do mês','10:00:00'),(14,'2014-07-13',190,'2014-07-10','Fiz uma visita ao Gustavo (TI) para verificar o andamento do projeto. O mesmo me informou que a Mercury está passando por uma série de mudanças e que estão com outras prioridades. Informou que na próxima quinta-feira (17) terá uma reunião com o diretor na qual o FLUIG será abordado.\r\n','13:00:00'),(15,'2014-07-13',190,'2014-07-17','Reunião interna do cliente na qual o assunto Fluig será abordado.','10:00:00'),(16,'2014-07-13',190,'2014-07-16','Certificar que a reunião interna do cliente ocorrerá e que o assunto Fluig será abordado.\r\n\r\nCertificar que o Gerente de TI tem todas as informações para a reunião.','14:00:00'),(17,'2014-07-13',190,'2014-07-17','Ligar para verificar se a reunião ocorreu e tratar dos próximos passos.','17:00:00'),(18,'2014-07-13',201,'2014-07-14','Cobrar Vania o ajuste da proposta ','09:00:00'),(19,'2014-07-13',201,'2014-07-14','Enviar proposta ajustada para Bart e Sergio ','12:00:00'),(20,'2014-07-13',201,'2014-07-15','Questionar Sergio referente a sugestões da proposta e receber status sobre Budget. ','10:00:00'),(21,'2014-07-13',201,'2014-07-14','Cobrar Flavia polido a proposta de SQL ','09:00:00'),(22,'2014-07-13',199,'2014-07-18','Ligar para Rafael, buscar informações sobre reunião com Gabrielle ','10:00:00'),(23,'2014-07-13',199,'2014-07-14','Pedir informações sobre MS AIX, para a Jaquielle e montar script de agurmentos com a Gabrielle. ','10:00:00'),(24,'2014-07-13',200,'2014-07-14','Falar com Robson, sobre reunião com Soraia e MKT martins ','14:00:00'),(25,'2014-07-13',202,'2014-07-14','Ligar para Eduardo, saber o que ele achou do orçamento enviado ','12:00:00'),(26,'2014-07-14',163,'2014-07-14','Entrar em contato com o Alex para verificar se já conseguiu aprovação/assinatura do Diretor Cesar, na ausência do Gary.','15:00:00'),(27,'2014-07-14',287,'2014-07-14','Contato para agenda de demonstração do fluig.\r\n\r\nConfirmado para 16/07 às 10h com Thiago Urbano','09:30:00'),(28,'2014-07-14',287,'2014-07-16','Demonstração do Fluig.\r\n\r\nAlinhamento dos próximos passos.','10:00:00'),(29,'2014-07-14',260,'2014-07-02','Contato com cliente para Agendar apresentacao do Modulo de Seguranca e Medicina do trabalho (Gestao do Capital Humano. Oportunidade de 4 licencas','10:30:00'),(30,'2014-07-14',260,'2014-07-11','Agendado inicialmente apresentacao Via Totvs Ocean porem cancelado pelo cliente e solicitada apresentacao on site ja confirmada com arquiteta Cassia para dia 16;07 nas instalacoes do cliente','17:00:00'),(31,'2014-07-14',154,'2014-07-03','Primeiro contato ocm cliente que solicitou 02 licencas para uma de suas lojas (PDV). Proposta enviada no mesmo dia','10:30:00'),(32,'2014-07-14',154,'2014-07-11','Contato com o cliente apos algumas tentativas ond eo mesmo solicitou um desconto no valor da Proposta. ','15:00:00'),(33,'2014-07-14',154,'2014-07-14','Contato com cliente para envio dos valores na data de 14/07. Somente apos acerto dos valores e entendimento estre as partes e que sera enviada proposta formal com previsoa de envio ate 17/07','11:00:00'),(300,'2014-08-03',170,'2014-07-31','Alinhamento feito com Gestão e informado que a aquisição se dará pós aprovação do Pacote de Serviços previstos para 2014.\r\n\r\nReunião para fechamento Serviços 05/08.','12:00:00'),(296,'2014-08-03',420,'2014-08-05','Cobrar a proposta assinada do cliente.','10:00:00'),(297,'2014-08-03',420,'2014-08-06','Cobrar a proposta assinada.','10:00:00'),(298,'2014-08-03',420,'2014-08-08','Data limite para entrada da proposta.','16:00:00'),(299,'2014-08-03',178,'2014-07-31','Cliente informou que Conselho não aprovou a aquisição propositiva.\r\n\r\nAdiar para Novembro.','10:00:00'),(295,'2014-08-03',420,'2014-08-04','Verificar se a proposta já está aprovada no CRM. Enviar a proposta para o cliente.','10:00:00'),(294,'2014-08-01',413,'2014-08-06','O cliente disse que está vendo outras solucoes e pediu 1 semana. \r\nVou ligar conforme combinamos e marcar uma reunião para o dia seguinte se possivel ou data mais proxima.','09:00:00'),(38,'2014-07-14',283,'2014-06-27','Solicitacao de cotacao de software complementar. Cotacao ennviada a Flavia Polido em SP no memso dia','16:30:00'),(39,'2014-07-14',283,'2014-07-03','apos ajustes de duvidas enviada proposta ao cliente no dia 07/03 com valores para duas licencas de winsr 2012','12:00:00'),(40,'2014-07-14',283,'2014-07-10','Contato com cliente que informou ter recebido proposta da Totvs muito acima da concorrencia. Ficou de enviar a ordem de grandeza da diferenca para verificarmos a possibilidade de fechamento com a Totvs que e a preferencia do cliente.','14:00:00'),(41,'2014-07-14',283,'2014-07-14','Contato ocm o cliente que informou ter recebido proposta com valor 16% menor que o valor Totvs. Ja encaminhada solicitacao de desconto a Flavia de SP. Aguardando retorno.','10:30:00'),(42,'2014-07-15',268,'2014-07-15','Entrar em contato com o cliente (Sandro Castro - Gerente de TI) para dar a resposta sobre a qtde. de horas estimada para este projeto.\r\nMontar junto com ele os próximos passos até a assinatura das propostas, tentando adiantar o prazo de fechamento até dia 25/07.\r\n\r\nFiz contato com o cliente e as propostas já foram apresentadas para o Diretor Cosme, que achou muito alto o valor.\r\nSugeri uma reunião com ele na quinta dia 17/07. Sandro vai verificar com Cosme o melhor horário e me confirmar a reunião.\r\nEles precisam decidir este projeto até final da semana que vem pois precisam finalizar em 01/09/14.\r\n\r\n\r\n\r\n\r\n','09:30:00'),(43,'2014-07-15',169,'2014-07-15','Entrar em contato com o cliente  (Vinícius ou Sandra - TI) para verificar se tiveram a reunião interna sobre a política de licenciamento SQL/Microsoft.\r\nE tentar agendar um call com a Flavia Polido e o cliente para esclarecer eventuais duvidas sobre o licenciamento SQL.','10:30:00'),(44,'2014-07-15',268,'2014-07-16','Entrar em contato para saber se a reunião com Diretor Cosme foi confirmada para dia 17/07 e qual horário.\r\n','10:00:00'),(45,'2014-07-15',268,'2014-07-17','Reunião pré-agendada com o diretor Cosme para negociar valores e condições de pagamento.\r\n','10:00:00'),(46,'2014-07-16',191,'2014-07-15','Contato para definir negociação','10:00:00'),(47,'2014-07-16',191,'2014-07-15','Paulo Henrique(TI) se comprometeu em apresentar a proposta para a diretoria até 17/07 e definir esta negociação.\r\n','10:00:00'),(48,'2014-07-16',191,'2014-07-16','Verificar com Renata Vilela(Arquiteta) se temos algum material sobre o ROI do Totvs Colaboração. E enviar a proposta atualizada.','09:00:00'),(49,'2014-07-16',191,'2014-07-16','Ligar para o Paulo para certificar que ele vai falar com o diretor.','16:00:00'),(50,'2014-07-16',191,'2014-07-17','Ligação de Follow up','16:00:00'),(51,'2014-07-16',191,'2014-07-18','Visita para fechar.','10:00:00'),(52,'2014-07-16',275,'2014-07-16','Confirmar disponibilidade da agenda do Thiago para 18/07. Demonstração para os influenciadores.\r\n','10:00:00'),(53,'2014-07-16',275,'2014-07-16','Alinhar uma agenda do Ramon na próxima semana para apresentação da proposta e negociação.','10:00:00'),(54,'2014-07-16',275,'2014-07-22','Demonstração do Fluig para os influenciadores (principalmente MKT) -  Adiada do dia 18 para 22/07 a confirmar.\r\n\r\nRisco: \r\nA Diretoria demonstrou interesse e quer participar da demonstração porém não estará disponível na próxima semana. A diretora de marketing é irmã do dono da Bagaggio e é a principal interessada.\r\n\r\nSolução:\r\nContato direto com a Diretora para garantir a demonstração no dia 22 ou outro dia da próxima semana.','10:00:00'),(55,'2014-07-16',275,'2014-07-28','Confirmar com o Ronaldo da Zeus a demonstração de amanhã.\r\n\r\n\r\n','10:00:00'),(56,'2014-07-16',58,'2014-07-16','Cobrar ação do Rafael ','08:30:00'),(57,'2014-07-16',58,'2014-07-18','Verificar se houve alguma evolução.','09:00:00'),(58,'2014-07-16',58,'2014-07-21','Escalonar para o Baliu','10:00:00'),(59,'2014-07-16',58,'2014-07-21','Informar ao cliente das ações tomadas e buscar agenda para tratar do GoodData.','10:00:00'),(60,'2014-07-17',167,'2014-07-17','Fazer contato com cliente para saber status da aprovação deste projeto junto ao Gestor de RH que fica na mina.\r\n\r\nContato feito com o João Carlos da TI. O processo deu uma parada pois chegaram consultores da matriz na Austrália para revisão de todos os processos da empresa. Este projeto de portal só será retomado após este trabalho de revisão de processos da área de RH ser concluído. Previsão: daqui a 2 meses. \r\nNa semana que vem o João Carlos estará na mina e no início da outra semana, dia 28/07 pode me dar uma previsão de data mais certa para retomada deste projeto.','14:00:00'),(61,'2014-07-17',167,'2014-07-28','Fazer novo contato com o João Carlos da TI para saber qual a previsão de retomada do projeto.','14:00:00'),(62,'2014-07-17',169,'2014-07-15','Contato feito com o cliente para saber se a reunião interna sobre licenciamento Microsoft (SQL) foi realizada. Verificamos que não estão compliance com a política de licenciamento SQL e estão averiguando a situação internamente.\r\n\r\nFui informada pelo Vinícius Gam