resentacao. cliente solicitou andamento de pendencias e envio de proposta de servicos','15:00:00'),(291,'2014-07-30',403,'2014-07-30','envio de proposta de servicos','15:00:00'),(292,'2014-07-30',393,'2014-08-01','levantamento para elaboração de nota fiscal eletrônica em 4 filias,migração de versão RM, migração Protheus para novos servidores ','15:00:00'),(301,'2014-08-03',172,'2014-07-23','Reunião de alinhamento quanto ao aumento da operação (mod. WMS)\r\n\r\nNecessidade de ajustes de licenças para enquadramento.','10:00:00'),(302,'2014-08-03',172,'2014-08-06','Agenda prevista para apresentação proposta.\r\n\r\nCombo Serviço + CDU','10:00:00'),(303,'2014-08-03',175,'2014-07-30','Finalizado Auditoria e entregue relatório ao cliente,\r\n\r\nRealizado call entre Progress + Totvs + Cliente.\r\n\r\nApresentado proposta e sinalizado prazo para regularização.','11:00:00'),(304,'2014-08-03',176,'2014-07-15','Cliente finalizou migração de novo servidor e agora será preciso subir o ambiente de contigencia.\r\n\r\nalinhamento para novo ambiente realizado, será submetido para aprovação da diretoria.','10:00:00'),(305,'2014-08-03',431,'2014-07-23','REUNIÃO DE ALINHAMENTO REFERENTE AO AUMENTO DA OPERAÇÃO.\r\n\r\nNECESSÁRIO ESTRUTURAR CENÁRIOS DE ADEQUAÇÃO.','15:00:00'),(306,'2014-08-03',431,'2014-07-29','REUNIÃO PARA ENTREGA DE  PROPOSTA E ALINHAMENTO PARA FECHAMENTO.\r\n\r\nCLIENTE IRA SUBMETER PARA DIRETORIA ADM.','16:00:00'),(307,'2014-08-03',157,'2014-08-04','Ligar para Carla para saber o resultado da revisão orçamentária','15:00:00'),(308,'2014-08-03',258,'2014-08-01','Cliente não deu feedback do dia 31 e disse que diretor viajou e não teve tempo de analisar. Pedi gentilmente mais comprometimento com as datas.\r\nTeremos uma reunião dia 5/08 para apresentação do FLUIG','10:30:00'),(309,'2014-08-03',433,'2014-08-04','Agendar apresentação técnica com arquiteto','15:00:00'),(310,'2014-08-04',281,'2014-08-04','Esta oportunidade está na fase em que o presidente está buscando Budget com o conselho da Igreja Universal.\r\n\r\nNa sexta-feira o presidente indicou que buscaria aprovação esta semana.\r\n\r\nFazer contato diariamente até fechar.','14:00:00'),(311,'2014-08-04',377,'2014-08-04','Verificar com a Karin o que foi feito nos últimos dias e apoiar no fechamento desta oportunidade.','12:00:00'),(312,'2014-08-04',156,'2014-08-08','remarcar Demo com os Usuarios','10:00:00'),(313,'2014-08-04',263,'2014-08-07','Reuniao para decidir um projeto que esta vinculado a proposta de CDU','09:00:00'),(314,'2014-08-04',441,'2014-08-04','Estamos fazendo vários levantamentos simultâneos para as outras empresas do grupo. Com o aceite desses orçamentos, o cliente decidirá se opta pelo Corporativo ou continua no modelo tradicional.\r\n\r\nTeremos uma reunião dia 12/08. O cliente tem interesse no Corporativo, mas já tem base de 2 outros orçamentos com parâmetros de faturamento diferentes. Pelo histórico, apesar do interesse, até a reunião contar como upside.','07:41:00'),(344,'2014-08-06',163,'2014-07-30','Tentei contato com o Alex sem sucesso.\r\nFiz contato com o Gerente de TI, Anderson, que tbm está a par do projeto.\r\nEle explicou que estão aprovando o projeto como um todo, Portais e e-social e precisa ainda tirar duvidas sobre o projeto de integração do e-social. Pediu uma nova reunião.\r\nVou ver agenda na semana que vem.','15:00:00'),(316,'2014-08-04',360,'2014-08-06','Visita de relacionamento.\r\n\r\nAgendar reunião de negociação para data posterior à reunião de conselho.','14:00:00'),(317,'2014-08-04',360,'2014-08-08','Certificar que a reunião de conselho ocorrerá e garantir que o assunto será abordado.','10:00:00'),(318,'2014-08-04',360,'2014-08-12','Resultado da reunião e início das ações para assinatura do contrato.','16:00:00'),(319,'2014-08-04',146,'2014-08-07','Cliente deixou de atender prazos, reunião nesta data para retomar negociações. Ainda aguardando resposta da Seguradora Líder.','00:00:00'),(320,'2014-08-04',275,'2014-07-30','Proposta 