posta','16:00:00'),(349,'2014-08-06',288,'2014-08-06','Ligar para o TI da empresa para confirmar o recebimento da proposta.','14:30:00'),(350,'2014-08-06',288,'2014-08-06','Ligar para a cliente para sanar dúvidas da proposta e confirmar o fechamento no período comitado.','17:00:00'),(351,'2014-08-06',288,'2014-08-07','Ligar para a cliente informando o reajuste nos preços e marcar a assinatura do contrato.','10:00:00'),(352,'2014-08-06',288,'2014-08-08','Assinar o contrato.','09:30:00');
